import React, {Component} from 'react';
import './App.css';

class App extends Component{
  render(){
    return(
      <div className="container">
        <form>
        <label for="cep">Digite o Cep</label><br/>
        <input id="cep" type="text"/>
        </form>
      </div>
    )
  }
}
export default App;
